INSERT INTO `db_product_designer` (`product_designer_sn`, `product_designer_id`, `product_designer_group`, `product_designer_name`, `product_designer_designation`, `product_designer_title`, `product_designer_massage`, `product_designer_picture`, `product_designer_approve_flag`, `product_designer_display_flag`) VALUES
(1, 'kamal', 'All', 'Md. Abdullah Al Kamal - Lotus', 'Fashion Designer', 'Entitled Fashion designer around the world. 10 Years experiences in World Fashion Industry.', 'Fashion is a popular style or practice, especially in clothing, footwear, accessories, makeup, hairstyle and body. Fashion is a distinctive and often constant trend in the style in which a person dresses. It is the prevailing styles in behaviour and the newest creations of textile designers.[1] Because the more technical term costume is regularly linked to the term \"fashion\", the use of the former has been relegated to special senses like fancy dress or masquerade wear, while \"fashion\" generally means clothing, including the study of it. Although aspects of fashion can be feminine or masculine, some trends are androgynous.', 'kamal.jpg', 'Yes', 'Yes'),
(2, 'priya', 'All', 'Priya Mehzabin', 'Fashion Designer', 'Entitled Fashion designer around the world. 20 Years experiences in World Fashion Industry.', 'The media plays a significant role when it comes to fashion. For instance, an important part of fashion is fashion journalism. Editorial critique, guidelines, and commentary can be found on television and in magazines, newspapers, fashion websites, social networks, and fashion blogs. In recent years, fashion blogging and YouTube videos have become a major outlet for spreading trends and fashion tips, creating an online culture of sharing one\'s style on a website or Instagram account. Through these media outlets readers and viewers all over the world can learn about fashion, making it very accessible.', 'priya.jpg', 'Yes', 'Yes');
