(6, 'The Plasma Science and Technology Laboratory, (PSTL) established in 2009, is dedicated to conducting scientific-research, professional and teaching activities, for graduate and postgraduate level, in the field of food production enhancement, plasma medicine, modifications of surfaces (Jute & Textile) and wastewater cleaning. These activities promote overall progress of the community and knowledge-based economic development. To this end, PSTL enables a rational use of available human and material resources, development of multi-disciplinary research and educational programs, international competitiveness of teaching, research and professional work, an increased level of innovation in society, faster knowledge transfer and strengthening of links between education, research and entrepreneurship. Finally, missions of PSTL is to produce sincere, dutiful and caring individuals with professional skills in the field of Plasma Science and Technology so that the graduates can competently face the challenges of the 21st century of the nation and render services to the international communities.  ');
