INSERT INTO `bottom_desp` (`id`, `top_desp`, `srt_desp`) VALUES
(1, 'PSTL intends to carry out important scientific research in the areas of (a) Plasma source design, (b) Enhancement of food production, (c) Surface modification (i.e. Diversified use of Jute and Textile) (d) Wastewater (Tannery and Textile) cleaning, and (e) Plasma medicine. Its current scientific potential needs to be further enhanced and directed towards achieving the highest possible visibility in Bangladesh and abroad. The Faculty should continue providing institutional support for the improvement of research careers, continually work towards reforming doctoral studies as the basis for the development of individuals who are the pillars of general development, encourage mobility and participation in post-doctoral trainings in various national and international projects, educate junior researchers through doctoral studies and create institutional framework for collaborative research activities and programs. One of the principal objectives for the Faculty is participation in the development of economy and society, with the aim to align achievements in those areas with the advancement of technology. Given the limited number of its highly educated professionals in Plasma Science and Technology should be involved in economic life, both in the region and beyond, through joint research projects and other forms of cooperation. One of its priority objectives is therefore to strengthen the capacities for research and development in order to ensure PSTL\'s competitiveness during its integration into national and international research programs. Additional PSTL\'s objectives are to use and manage intellectual property arising from the Faculty\'s research, and to encourage the creation of start-up companies based on the research results and the use of technology. PSTL is striving to be the key factor that enables the so called knowledge triangle (education, research, innovation) by bringing the Faculty\'s technologies to the market and promoting economic development. The cooperation is carried out through joint projects, provision of analytical services, implementation of new technologies, creation of expert reports etc.', 'PSTL intends to carry out important scientific research in the areas of (a) Plasma source design, (b) Enhancement of food production, (c) Surface modification (i.e. Diversified use of Jute and Textile) (d) Wastewater (Tannery and Textile) cleaning, and (e) Plasma medicine. Its current scientific potential needs to be further enhanced and directed towards achieving the highest possible visibility in Bangladesh and abroad. ');
