INSERT INTO `top_desp` (`id`, `top_desp`, `srt_desp`) VALUES
(1, 'It should be mentioned that the PSTL is the only experimental research laboratory in Bangladesh, which has been established in 2009 by Professor Mamunur Rashid Talukder (M. R. Talukder) in the Department of Applied Physics and Electronic Engineering of the University of Rajshahi. PSTL has enrolled 3 Ph. D., 4 M. Sc. and 3 graduates (2018). 2007- to date, the research activities at PSTL have been carried out through different research projects funded by the Ministry of Science and Technology, UGC and the University of Rajshahi. In the period from 1997 to 2016, PSTL published 66 research articles. ', 'It should be mentioned that the PSTL is the only experimental research laboratory in Bangladesh, which has been established in 2009 by Professor Mamunur Rashid Talukder (M. R. Talukder) in the Department of Applied Physics and Electronic Engineering of the University of Rajshahi.');
INSERT INTO `vission` (`id`, `title`, `description`) VALUES
(12, 'How Plasma Science and Technology help humane and nature?', 'PSTL , in accordance with its mission, its clear research profile, its teaching process which is grounded on new scientific achievements, learning outcomes and principles of lifelong learning, as well as its involvement in the International Research and Higher Education Area, will be one of the dynamic centers in the field of Plasma Sciences and Technology that will contribute to the transition of Bangladesh to a knowledge-based society. It will be a reference point and a hub of cooperation with other universities and institutions at the international, national and local levels and the leading higher educational institution for scientific research in the region. The Lab members will continue its work as a socially responsible institution in the educational, scientific and professional field, and professionals trained at PSTL will be interdisciplinary educated and competent in solving problems in their areas, to the benefit of the entire community. One of the principal objectives for the Lab members is participation in the development of economy and society, with the aim to align achievements in those areas with the advancement of technology. One of its priorities as objective is therefore to strengthen the capacities for research and development in order to ensure PSTL\'s competitiveness during its integration arising from the PSTL\'s research and encourage the creation of start-up companies based on research results and the use of technology. PSTL is striving to be the key factor that enables the so called knowledge triangle (education, research, innovation) by bringing the Faculty\'s technologies to market and promoting economic development.');
